window.bookSummaryJSON = "<p>Back from the treasure hunt, it’s time to explore Earth a little more....<br> <br> But first, Jake has a family to visit, and an auction to attend. Then, it’s time to face the challenges the planet has to offer, and by using the many rewards from the treasure hunt, Jake aims to improve his repertoire while getting some more levels under his belt.<br> <br> And what could be a better idea than invading a massive termite hive to craft a new weapon using the extremely powerful curse of resentment from an ancient vampire land? Yeah, nothing could possibly go wrong with that. Ancient curses are well-known for being harmless, after all.<br> <br> Assuming all goes well–which it surely will–Jake has one more challenge he must face. Perhaps his most dangerous one yet.<br> <br> That’s right, it’s back-to-school season.<br> <br> School in this case being an ancient Order worshipping a Primordial snake god.</p> <p>Book six of the hit Primal Hunter LitRPG series is here. Download today!</p> <p>About the series: Experience an apocalypse LitRPG with levels, classes, professions, skills, dungeons, loot, and all of the great traits of progression fantasy and LitRPG that you've come to expect. Follow Jake as he explores this new vast multiverse filled with challenges and opportunities as he grows in power and slowly transforms from a bored office worker to a true apex hunter.</p>"; 
